import React, { useState } from 'react';
import Login from './pages/Login';
import Dashboard from './components/Dashboard';

function App() {
  const [userLogged, setUserLogged] = useState(false);

  return userLogged ? (
    <Dashboard />
  ) : (
    <Login onLogin={() => setUserLogged(true)} />
  );
}

export default App;
